--
-- Create procedure `Proc_Student_GetSearch`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Student_GetSearch (IN `@keyword` varchar(100))
COMMENT '-- Author:        KhaiND
  -- Created date:  20/12/2022
  -- Description:   Tìm kiếm học sinh thông qua từ khóa chứa trong Họ và tên
  -- Modified by:
  -- Code chạy thử: CALL `misa.fw0922.gd.qlth.khoanthu`.Proc_Student_GetSearch(`an`);'
BEGIN
  IF IFNULL(`@keyword`, '') = '' THEN
    SET `@keyword` = '';
  END IF;

  SET @searchQuery = CONCAT('SELECT s.StudentID, s.StudentName, s.StudentDateOfBirth, b.BranchName FROM student s LEFT JOIN branch b ON s.BranchID = b.BranchID WHERE s.StudentName LIKE \'%', `@keyword`, '%\' ORDER BY b.BranchName, s.StudentName, s.StudentDateOfBirth');

  PREPARE searchQuery FROM @searchQuery;
  EXECUTE searchQuery;
  DEALLOCATE PREPARE searchQuery;
END
$$

--
-- Create procedure `Proc_StudentExemption_GetPagingByStudent`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_StudentExemption_GetPagingByStudent (IN `@offset` int, -- Số thứ tự bản ghi bắt đầu của trang tương ứng (tính từ 0)
IN `@limit` int -- Số bản ghi trên một trang
)
COMMENT '-- Author:        KhaiND
  -- Created date:  21/12/2022
  -- Description:   Lấy danh sách thông tin miễn giảm các học sinh và phân trang sắp xếp theo học sinh (lớp)
  -- Modified by:
  -- Code chạy thử: CALL `misa.fw0922.gd.qlth.khoanthu`.Proc_StudentExemption_GetPagingByStudent(0, 20);'
BEGIN

  IF (IFNULL(`@offset`, '') = '')
    OR `@offset` < 0 THEN
    SET `@offset` = 0;
  END IF;

  IF `@limit` < 1 THEN
    SET @query = CONCAT('SELECT se.StudentExemptionID, s.StudentName, s.StudentDateOfBirth, b.BranchName, se.StudentExemptionLevel, se.StudentExemptionLevelIsUnitByPercent, f.FeeName, se.StudentExemptionTime, e.ExemptionName FROM studentexemption se LEFT JOIN student s ON se.StudentID = s.StudentID LEFT JOIN exemption e ON se.ExemptionID = e.ExemptionID LEFT JOIN fee f ON se.FeeID = f.FeeID LEFT JOIN branch b ON s.BranchID = b.BranchID ORDER BY b.BranchName, s.StudentName, s.StudentDateOfBirth, f.FeeName, e.ExemptionName, se.StudentExemptionTime');
  ELSE
    SET @query = CONCAT('SELECT se.StudentExemptionID, s.StudentName, s.StudentDateOfBirth, b.BranchName, se.StudentExemptionLevel, se.StudentExemptionLevelIsUnitByPercent, f.FeeName, se.StudentExemptionTime, e.ExemptionName FROM studentexemption se LEFT JOIN student s ON se.StudentID = s.StudentID LEFT JOIN exemption e ON se.ExemptionID = e.ExemptionID LEFT JOIN fee f ON se.FeeID = f.FeeID LEFT JOIN branch b ON s.BranchID = b.BranchID ORDER BY b.BranchName, s.StudentName, s.StudentDateOfBirth, f.FeeName, e.ExemptionName, se.StudentExemptionTime LIMIT ', `@limit`, ' OFFSET ', `@offset`);
  END IF;

  PREPARE query FROM @query;
  EXECUTE query;
  DEALLOCATE PREPARE query;

  SET @countQuery = CONCAT('SELECT COUNT(*) AS \'TotalRecord\' FROM studentexemption se LEFT JOIN student s ON se.StudentID = s.StudentID LEFT JOIN exemption e ON se.ExemptionID = e.ExemptionID LEFT JOIN fee f ON se.FeeID = f.FeeID LEFT JOIN branch b ON s.BranchID = b.BranchID');

  PREPARE countQuery FROM @countQuery;
  EXECUTE countQuery;
  DEALLOCATE PREPARE countQuery;

END
$$

