--
-- Create procedure `Proc_Fee_GetSearch`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Fee_GetSearch (IN `@keyword` varchar(255))
COMMENT '-- Author:        KhaiND
  -- Created date:  20/12/2022
  -- Description:   Tìm kiếm thông tin khoản thu
  -- Modified by:
  -- Code chạy thử: CALL `misa.fw0922.gd.qlth.khoanthu`.Proc_Fee_GetSearch(`học`);'
BEGIN
  IF IFNULL(`@keyword`, '') = '' THEN
    SET `@keyword` = '';
  END IF;

  SET @searchQuery = CONCAT('SELECT FeeID, FeeName FROM fee WHERE FeeName LIKE \'%', `@keyword`, '%\' ORDER BY FeeName');

  PREPARE searchQuery FROM @searchQuery;
  EXECUTE searchQuery;
  DEALLOCATE PREPARE searchQuery;
END
$$

--
-- Create procedure `Proc_Exemption_GetSearch`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Exemption_GetSearch (IN `@keyword` varchar(255))
COMMENT '-- Author:        KhaiND
  -- Created date:  20/12/2022
  -- Description:   Tìm kiếm thông tin diện miễn giảm
  -- Modified by:
  -- Code chạy thử: CALL `misa.fw0922.gd.qlth.khoanthu`.Proc_Exemption_GetSearch(`on`);'
BEGIN
  IF IFNULL(`@keyword`, '') = '' THEN
    SET `@keyword` = '';
  END IF;

  SET @searchQuery = CONCAT('SELECT ExemptionID, ExemptionName, ExemptionDescription, ExemptionFixLevel, ExemptionFixLevelIsUnitByPercent  FROM exemption WHERE ExemptionName LIKE \'%', `@keyword`, '%\' ORDER BY ExemptionName');

  PREPARE searchQuery FROM @searchQuery;
  EXECUTE searchQuery;
  DEALLOCATE PREPARE searchQuery;
END
$$

